import React, { Component } from "react";
import { StyleSheet, View, Text } from "react-native";
import CupertinoButtonPurple from "../components/CupertinoButtonPurple";

function SettingsPage(props) {
  return (
    <View style={styles.container}>
      <Text style={styles.settings}>Settings</Text>
      <View style={styles.cupertinoButtonPurpleRow}>
        <CupertinoButtonPurple
          caption="Change Password"
          style={styles.cupertinoButtonPurple}
        ></CupertinoButtonPurple>
        <CupertinoButtonPurple
          caption="Change E-Mail"
          style={styles.cupertinoButtonPurple1}
        ></CupertinoButtonPurple>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1
  },
  settings: {
    fontFamily: "roboto-700",
    color: "rgba(0,0,0,1)",
    fontSize: 90,
    borderWidth: 1,
    borderColor: "#000000",
    textAlign: "center",
    width: 1920,
    height: 117,
    marginTop: 32
  },
  cupertinoButtonPurple: {
    height: 106,
    width: 360,
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3
    },
    elevation: 5,
    shadowOpacity: 0.5,
    shadowRadius: 0
  },
  cupertinoButtonPurple1: {
    height: 106,
    width: 360,
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3
    },
    elevation: 5,
    shadowOpacity: 0.5,
    shadowRadius: 0,
    marginLeft: 364
  },
  cupertinoButtonPurpleRow: {
    height: 106,
    flexDirection: "row",
    marginTop: 123,
    marginLeft: 398,
    marginRight: 438
  }
});

export default SettingsPage;
